package com.thebigfun.event_service.service;import java.util.List;public interface EventService {    public abstract EventService createEvent(EventService eventService);    public abstract List<EventService> getAllEvents();    public abstract EventService getEventById(Long event_id);    public abstract EventService updateEvent(Long event_id, EventService eventService);    public abstract void deleteEvent(Long event_id);    public abstract boolean existsEventByEventId(Long event_id);}